import UIKit

public class PhotoDetailPresenter: PhotoDetailPresenterProtocol {

    weak private var view: PhotoDetailViewProtocol?
    var interactor: PhotoDetailInteractorProtocol?
    private let router: PhotoDetailWireframeProtocol

    init(interface: PhotoDetailViewProtocol, interactor: PhotoDetailInteractorProtocol?, router: PhotoDetailWireframeProtocol) {
        self.view = interface
        self.interactor = interactor
        self.router = router
    }

    //MARK: - GoBack
    func goBack(nav: UINavigationController?) {
